insert  into `sites`(`site_id`,`site_name`,`site_title`,`site_domain`,`site_subtitle`,`site_background_img`,`site_rightside_img`,`site_icon1`,`site_icon1_title`,`site_icon1_desc`,`site_icon2`,`site_icon2_title`,`site_icon2_desc`,`site_icon3`,`site_icon3_title`,`site_icon3_desc`,`site_icon4`,`site_icon4_title`,`site_icon4_desc`,`site_findoutmorelink`,`site_sec_title`,`site_sec_desc`,`site_sec_link`,`site_default_title`,`site_default_desc`,`site_default_image`,`site_primary_title`,`site_primary_desc`,`site_primary_image`,`site_our_team`,`site_about_title`,`site_about_desc`,`site_about_image`,`site_address`,`site_phone`,`site_email`,`site_timings`,`site_links`,`site_admin_email`,`site_lat`,`site_lng`) values (1,'My Religion','My Incredible Religion','myreligion.tk','Convert your ideas into your Religion','http://quotesideas.com/wp-content/uploads/2015/02/Religion-quote-on-background-hd-2015.jpeg','http://www.allahsword.com/images/books/comparative_religion/comparative_religion_main.png','fa-hand-o-up','Belief','Believe in your own religion. Your views are your religion.','fa-gavel','Leadership','Be a leader of your own religion.','fa-book','Holy Book','Create your holy book by adding your views as verses.','fa-user','Founder','You are the founder of your own religion.',NULL,'Religious Slogan','Science without religion is lame, religion without science is blind.','about.php','Religious Belief','<ul class=\"feature-list\">\r\n<li><i class=\"glyphicon glyphicon-ok\"></i> Faith - It does not make things easy, it makes them possible.</li>\r\n<li><i class=\"glyphicon glyphicon-ok\"></i> Free Trip to heaven. Details Inside.</li>\r\n<li><i class=\"glyphicon glyphicon-ok\"></i> God can hear you.</li>\r\n<li><i class=\"glyphicon glyphicon-ok\"></i> God has a great plan for your life.1</li>\r\n<li><i class=\"glyphicon glyphicon-ok\"></i> God is stronger than my circumstances.</li>\r\n</ul>','https://www.prageru.com/sites/default/files/courses/badges/badge_religioustolerancemadeinamerica.png','More Religious Belief','<ul class=\"feature-list\">\r\n<li><i class=\"glyphicon glyphicon-ok\"></i> I believe in God. Never panic, just pray.</li>\r\n<li><i class=\"glyphicon glyphicon-ok\"></i> If God is for us, Who can be against us?</li>\r\n<li><i class=\"glyphicon glyphicon-ok\"></i> Know God, Know Peace; No God, No Peace.</li>\r\n<li><i class=\"glyphicon glyphicon-ok\"></i> People are like tea bags  you have to put them in hot water before you know how strong they are.</li>\r\n</ul>','http://i.dailymail.co.uk/i/pix/2017/03/10/14/3E234A1D00000578-4301306-image-a-33_1489155831037.jpg',NULL,NULL,'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Maecenas volutpat, sem quis ornare bibendum, metus odio commodo ante, sit amet finibus sapien nibh vel augue. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Maecenas risus nunc, tristique ac mi non, elementum venenatis elit. Nullam ornare laoreet justo, in dignissim ligula faucibus sit amet.\r\n\r\nSuspendisse tristique diam eu ex dapibus, non finibus quam pellentesque. Fusce eleifend magna vitae sem maximus, eu luctus eros finibus. Aliquam urna leo, finibus vel turpis eget, pretium hendrerit metus. Sed a leo elementum, tempor purus at, lacinia lorem. Praesent porttitor sed ipsum at consequat. Nunc\r\n\r\nLorem ipsum dolor sit amet, consectetur adipiscing elit. Maecenas risus nunc, tristique ac mi non, elementum venenatis elit. Nullam ornare laoreet justo, in dignissim ligula faucibus sit amet.','http://lifereminder.tk/images/puzzle.jpg','89 West Main st Merrimac, MA 01860','(555) 555-5555','site@myreligion.tk','Monday - Friday: 9.00 am to 5.00 pm',NULL,'admin@myreligion.tk',12,13);

/*Table structure for table `users` */

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `user_id` int(11) NOT NULL AUTO_INCREMENT,
  `email` varchar(150) DEFAULT NULL,
  `first_name` varchar(50) DEFAULT NULL,
  `last_name` varchar(50) DEFAULT NULL,
  `password` varchar(50) DEFAULT NULL,
  `gender` enum('male','female') DEFAULT NULL,
  `created_dt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `access_level` enum('member','admin') DEFAULT NULL,
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `users` */

/*Table structure for table `users_auth` */

DROP TABLE IF EXISTS `users_auth`;

CREATE TABLE `users_auth` (
  `user_id` int(11) NOT NULL AUTO_INCREMENT,
  `display_name` varchar(255) DEFAULT NULL,
  `profile_img` varchar(255) DEFAULT NULL,
  `email` varchar(255) DEFAULT NULL,
  `provider_id` enum('google.com','facebook.com','twitter.com','github.com','email1','email2') DEFAULT NULL,
  `password` varchar(50) DEFAULT NULL,
  `access_level` enum('member','admin') NOT NULL DEFAULT 'member',
  `user_created_dt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `uid` varchar(255) DEFAULT NULL,
  `logged_in_time` bigint(20) DEFAULT NULL,
  `profile_uid` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

